import { Link } from "react-router-dom";
import styled from 'styled-components';
import { MdClose } from 'react-icons/md';

const Background = styled.div`
  width: 100%;
  height: 100%;
  background: #29313D;
  position: fixed;
  display: flex;
  justify-content: center;
  align-items: center;


`;

const ModalWrapper = styled.div`
  width: 900px;
  height: 540px;

  position: relative;
  z-index: 10;
  border-radius: 20px;
  background-color:#F0F0EE;
  mix-blend-mode: normal;
`;


const ModalContent = styled.div`

  flex-direction: column;
  justify-content: center;
  align-items: center;
  line-height: 1.8;
  margin-top: 45px;
  text-align: center;

  h1{
    font-weight: 100;
    font-style: normal;  
    font-family: 'Poppins', sans-serif;
    color: #29313D;
    background-color:#F0F0EE;
  }
  p {
    background-color:white;

  }
  table{
    background-color:white;
  }
  tr{
    background-color:white;
  }
  td{
    background-color:white;
  }
  tbody{
    background-color:white;
  }
  div{
    background-color:white;
  }
  span{
    background-color:white;
  }
  b{
    background-color:white;  
  }



`;

const CloseModalButton = styled(MdClose)`
  cursor: pointer;
  position: absolute;
  top: 20px;
  right: 20px;
  width: 32px;
  height: 32px;
  padding: 0;
  z-index: 10;
  background-color: #F0F0EE;`



